import React from 'react';
import { CMS_NAME } from 'lib/constants';

const Intro = () => {
  return (
    <section>
      <h1>
        Blog.
      </h1>
      <h4>
        A statically generated blog example using{' '}
        <a
          href="https://nextjs.org/"
        >
          Next.js
        </a>{' '}
        and {CMS_NAME}.
      </h4>
    </section>
  )
}

export default Intro;
